/*
Hack an Epson TM-T88 thermal printer (the ones that print receipts in a supermarket till) and remotely control it through a WiFi-enabled ESP32.

This code :
- connects to a given WiFi network
- starts an HTTP server on port 80
- serves a basic page that allows one to type some text in a text area
- once a button is pressed it sends that text through a serial link to the thermal printer and tells it to cut the paper at the end
- also, the setup steps are printed on the integrated OLED display
*/

HardwareSerial serialPrinter(1);

#include <WiFi.h>
#include <ESP32WebServer.h>
#include "SSD1306.h" // alias for `#include "SSD1306Wire.h"`

ESP32WebServer server(80);

// Initialize the OLED display using Wire library
SSD1306  display(0x3c, 5, 4);


void setup() {
  Serial.begin(500000);

  display.init();
  display.drawString(0, 0, "Starting...");
  display.display();
  

  serialPrinter.begin(19200, SERIAL_8N1, 25, 26);

  

  display.drawString(0, 10, "Connecting to WiFi...");
  display.display();
  WiFi.begin("SSID", "password");
  /*wait until ESP32 connect to WiFi*/
  while (WiFi.status() != WL_CONNECTED) {
      delay(500);
      Serial.print(".");
  }
  display.drawString(0, 20, "\nWiFi connected, IP address: "); 
  display.drawString(0, 30, WiFi.localIP().toString());
  display.display();


  server.onNotFound(handleNotFound);
  server.on("/", menu);
  server.on("/print", sendToPrinter);
  
  
  server.begin();
  display.drawString(0, 40, "HTTP started on port 80");
  display.display();
}



void loop() {
  // deals with the Wifi clients and responds, calls the callbacks, etc. ...
  server.handleClient();
  delay(1);
}



void menu() {
  Serial.println("Menu...");
  String message = "<h1>Thermal Printer</h1>";
  message += "<form action=\"/print\" id=\"frm\"><input type=\"submit\" value=\"Send to printer\"  style=\"height:200px;width:200px\"> </form>";
  message += "<textarea rows=\"10\" cols=\"50\" name=\"text\" form=\"frm\"> Enter text here...</textarea>";
  server.send(200, "text/html", message);
}

void sendToPrinter() {
  // we expect one and only 1 var which is the text to print
  String var = server.argName(0);
  String value = server.arg(0);


  if (var == "text") {
    Serial.print("Received to print: "); Serial.println(value);
    serialPrinter.println(value);
    cutPaper();
    
  } 
  else Serial.println("UNKNOWN var " + var );

  menu();
}


void cutPaper() {
  //extra empty rows to cut below the latest text
  serialPrinter.println("\n\n\n");
  byte cutCmd[] = {0x1B, 0x69, 0x0A};
  serialPrinter.write(cutCmd, sizeof(cutCmd));
}

void handleNotFound() {
  String message = "File Not Found\n\n";
  message += "URI: " + server.uri();
  message += "\nMethod: " + (server.method() == HTTP_GET)?" GET":" POST";
  message += "\nArguments: " + server.args();
  message += "\n";
  for (uint8_t i=0; i<server.args(); i++){
    message += " " + server.argName(i) + ": " + server.arg(i) + "\n";
  }
  server.send(404, "text/plain", message);
}

#include <algorithm>
#include <iostream>
#include <array>
#include <vector>
#include <numeric>
#include <random>
#include <chrono>
#include <set>
#include <map>
#include <queue>

#define int long long
using namespace std;

const long long INF = 1e9 + 7;
const int MAXN = 1e5 + 1000;
const int N = 1e5 + 10;

vector<vector<pair<int, int>>> g;
vector<vector<int>> tree;
array<int, MAXN> used, tin, up, color;
int timer = 0;
set<int> bridge;
map<int, pair<int, int>> decompress;

void dfs(int v, int e = -1) {
    used[v] = true;
    tin[v] = up[v] = timer++;
    for (auto [to, num]: g[v]) {
        if (num == e) {
            continue;
        }
        if (used[to]) {
            up[v] = min(up[v], tin[to]);
        } else {
            dfs(to, num);
            up[v] = min(up[v], up[to]);
            if (up[to] > tin[v]) {
                bridge.insert(num);
            }
        }
    }
}

int col = 0;

void paint(int v) {
    used[v] = true;
    color[v] = col;
    for (auto [to, num]: g[v]) {
        if (bridge.contains(num)) {
            continue;
        }
        if (!used[to]) {
            paint(to);
        }
    }
}

inline void solve() {
    int n, m;
    cin >> n >> m;
    g.clear();
    g.resize(n);
    for (int i = 0; i < m; ++i) {
        int u, v;
        cin >> u >> v;
        --u, --v;
        g[u].emplace_back(v, i);
        g[v].emplace_back(u, i);
        decompress[i] = {u, v};
    }

    used.fill(0); // нахождение мостов
    tin.fill(0);
    up.fill(0);
    bridge.clear();
    timer = 0;
    for (int i = 0; i < n; ++i) {
        if (!used[i]) {
            dfs(i);
        }
    }

    used.fill(0); // раскраска компонент без мостов
    color.fill(0);
    col = 0;
    for (int i = 0; i < n; ++i) {
        if (!used[i]) {
            paint(i);
            ++col;
        }
    }

    tree.clear(); // построение дерева
    tree.resize(n);
    for (auto& i: bridge) {
        auto [u, v] = decompress[i];
        u = color[u];
        v = color[v];
        tree[u].emplace_back(v);
        tree[v].emplace_back(u);
    }

    vector<int> d(col, -1);
    queue<int> q;
    d[0] = 0;
    q.push(0);
    int max_dist = 0;
    while (!q.empty()) {
        int v = q.front();
        q.pop();
        for (auto to: tree[v]) {
            if (d[to] == -1) {
                d[to] = d[v] + 1;
                q.push(to);
            }
            if (d[to] > d[max_dist]) {
                max_dist = to;
            }
        }
    }

    fill(d.begin(), d.end(), -1);
    int start = max_dist;
    d[start] = 0;
    q.push(start);
    while (!q.empty()) {
        int v = q.front();
        q.pop();
        for (auto to: tree[v]) {
            if (d[to] == -1) {
                d[to] = d[v] + 1;
                q.push(to);
            }
            if (d[to] > d[max_dist]) {
                max_dist = to;
            }
        }
    }

    cout << bridge.size() - d[max_dist] << '\n';
}

signed main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);

    int tt = 1;
    cin >> tt;
    while (tt--) {
        solve();
    }
}

